        DB::table('language_keyword')->truncate();

        foreach ($languagesKeywords as $languageKeyword) {
            DB::table('language_keyword')->insert([
                'language_id' => $languageKeyword['language_id'],
                'keyword_id' => $languageKeyword['keyword_id'],
                'translation' => $languageKeyword['translation'],
                'created_at' => now(),
                'updated_at' => now(),
